INSERT INTO `QuestProducts` (`productID`, `ProductName`, `Description`, `ImageURL`, `DollarPrice`, ``, ``, ``) VALUES ('1', 'Acer Aspire R 15 2-in-1 Laptop, 15.6" Full HD Touch, 7th Gen Intel Core i7, GeForce 940MX, , 12GB DDR4, 256GB SSD, R5-571TG-7229', 'Acer R5-571TG-7229 comes with these high level specs: 7th Generation Intel Core i7-7500U Processor 2.7GHz with Turbo Boost Technology up to 3.5GHz (4MB L3 cache), Windows 10 Home, 15.6" Full HD (1920 x 1080) widescreen LED-backlit IPS display - Multi-touch screen, supporting 10-finger touch, NVIDIA GeForce 940MX with 2GB of dedicated GDDR5 VRAM, 12GB DDR4 Dual Channel Memory, 256GB SSD, Secure Digital (SD) card reader, Acer True Harmony High-Performance Sound System, Two built-in stereo speakers with subwoofer and built-in dual microphones, 802.11ac Wi-Fi featuring 2x2 MU-MIMO technology (Dual-Band 2.4GHz and 5GHz), Bluetooth 4.0, HD Webcam (1280 x 720), Acer Fingerprint Reader supporting Windows Hello, 1 - USB 3.1 (Type C) port (Gen 1 up to 5 Gbps), 2 - USB 3.0 Ports (One with Power-off Charging), 1 - USB 2.0 port, 1 - HDMI port with HDCP support, 4-cell Li-Ion Battery (3220 mAh), Up to 9-hours Battery Life, 4.74 lbs. | 2.15 kg (system unit only), Microsoft Signature (NX.GP7AA.001).', 'https://images-na.ssl-images-amazon.com/images/I/71Tl%2BD5RcNL._SL1500_.jpg', '799.99', '', '', ''),('2', 'Acer Aspire E 15 E5-575-33BM 15.6-Inch FHD Notebook (Intel Core i3-7100U 7th Generation , 4GB DDR4, 1TB 5400RPM HD, Intel HD Graphics 620, Windows 10 Home), Obsidian Black', 'Acer Aspire E5-575-33BM comes with these high level specs: 7th Generation Intel Core i3-7100U Processor (2.4GHz, 3MB L3 cache), Windows 10 Home, 15.6" Full HD Widescreen LED-backlit Display, Intel HD Graphics 620, 4GB DDR4 Memory, 1TB SATA Hard Drive (5400RPM), 8X DVD-Super Multi Double-Layer Drive (M-DISC enabled), Secure Digital (SD) card reader, High Definition Audio Support, 802.11ac Wi-Fi featuring MU-MIMO technology (Dual-Band 2.4GHz and 5GHz), Bluetooth 4.1, Gigabit Ethernet, Built-In HD Webcam (1280 x 720) supporting High Dynamic Range (HDR), 1 - USB 3.1 (Type C) port, 2 - USB 3.0 Ports (One with Power-off Charging), 1 - USB 2.0 Port, 1 - HDMI Port with HDCP support, 6-cell Li-ion Battery (2800 mAh), Up to 12-hours Battery Life, 5.27 lbs. | 2.39 kg (system unit only) (NX.GG5AA.005)', 'https://images-na.ssl-images-amazon.com/images/I/61Yeir0uhIL._SL1322_.jpg', '349.99', '', '', ''),('3', 'ASUS ZenPad 8 Dark Gray 8-inch Android Tablet [Z380M] 2MP Front / 5MP Rear PixelMaster Camera, WXGA TouchScreen, 16GB Onboard Storage, Quad-Core 1.3GHz Processor, 802.11a/b/g/n WiFi', 'ASUS Zenpad Z380M-A2-GR Touch Screen 8" IPS WXGA (1280800) 189 PPI, MTK 8163 Quad-Core 1.3GHz, 2GB DDR3L, Mali-T720, 16GB EMMC, Android 6.0 (Marshmallow), 802.11abgn, 2MP Front & 5MP Rear, Bluetooth 4.0, Dark Grey', 'https://images-na.ssl-images-amazon.com/images/I/41JYmgGBhRL.jpg', '126', '', '', ''),('4', 'Apple iPad 9.7 with WiFi, 128GB- Space Gray (2017 Newest Model) (Certified Refurbished)', 'Processor: 1.65 GHz None RAM: 128 GB DDR4 Graphics Coprocessor: M9 Wireless Type : 802.11 a/b/g/n/ac', 'https://images-na.ssl-images-amazon.com/images/I/61fCSQw997L._SL1000_.jpg', '359.99', '', '', ''),('5', 'Apple iPhone 7 , GSM Unlocked, 32GB - Rose Gold (Certified Refurbished)', 'An A10 Fusion chip for up to 2x faster performance than iPhone 6. Touch ID. A 4.7-inch Retina HD display with wide color and 3D Touch. Faster LTE. Immersive stereo sound, splash and water resistant, and iOS 10. • The iPhone 7 display uses the same color space as the digital cinema industry, so what you see will be noticeably more brilliant and vibrant. • When you use 3D Touch, your iPhone responds with subtle taps. The new Retina HD display deeply integrates 3D Touch throughout iOS. Now you can interact with Messages, Calendar, Mail, and other apps. • We’ve reengineered that beloved camera, adding optical image stabilization, an ƒ/1.8 aperture, and a six-element lens to make it even better for shooting photos and videos in low light. And with advanced new features like wide color capture, your photos and Live Photos will look even more vibrant. • With its entire enclosure reengineered, it is the very first water resistant iPhone. • iPhone 7 is supercharged by the most powerful chip ever in a smartphone. It’s not just faster than any previous iPhone, it’s also more efficient. It enables faster processing when you need it and the ability to use even less power when you don’t. And with the longest battery life ever in an iPhone, you can work at twice the speed of iPhone 6 and still enjoy more time. • Weight: 4.87 ounces (138 grams); Height: 5.44 inches (138.3 mm); Width: 2.64 inches (67.1 mm); Depth: 0.28 inch (7.1 mm) •', 'https://images-na.ssl-images-amazon.com/images/I/71x3e0x%2BM2L._SL1382_.jpg', '406.5', '', '', ''),('6', 'Samsung Galaxy S8 64GB Unlocked Phone - International Version (Midnight Black)', 'Meet the Galaxy S8 - Infinitely Brilliant. The Galaxy S8 has the world's first Infinity Screen, A screen without limits. The expansive display stretches from edge to edge, giving you the most amount of screen in the least amount of space. The revolutionary design of the Galaxy S8 begins from the inside out. We rethought every part of the phone's layout to break through the confines of the smartphone screen. So all you see is pure content and no bezel. It's the biggest, most immersive screen on a Galaxy smartphone of this size. And it's easy to hold in one hand. The Infinity Display has an incredible end-to-end screen that spills over the phone’s sides, forming a completely smooth, continuous surface with no bumps or angles. It’s pure, pristine, uninterrupted glass. And it takes up the entire front of the phone, flowing seamlessly into the aluminum shell. The result is a beautifully curved, perfectly symmetrical, singular object. Capture life as it happens with the Galaxy S8 cameras. The 12MP rear camera and the 8MP front camera are so accurate and fast that you won't miss a moment, day or night. Prying eyes are not a problem when you have iris scanning on the Galaxy S8. No two irises have the same pattern, not even yours, and they're nearly impossible to replicate. That means with iris scanning, your phone and its contents open to your eyes only. And when you need to unlock really fast, face recognition is a handy option. You never really stop using your phone. That's why Galaxy S8 is driven by the world's first 10nm processor. It's fast and powerful and increases battery efficiency. Plus, there's the ability to expand storage, and to work through rain and dust with IP68-rated performance.', 'https://images-na.ssl-images-amazon.com/images/I/61FgyIm6rLL._SL1383_.jpg', '627.78', '', '', ''),('7', 'TracFone LG Premier Android CDMA 4G LTE Smartphone - Certified Preowned', 'The TracFone LG premier LTE Android prepaid smartphone serves as a useful alternative to people who don't want to commit to a month-to-month cell service plan. With this item, you can pay as-you-go. This allows you to track the amount of money you're spending easily. This prepaid smartphone comes fully loaded with a wide variety of applications, including Wi-Fi, GPS and Bluetooth. With it, you can access over a million other apps on Google play. It comes with a camera, so you can snap shots and share them with friends. Use the MP3 player to listen to your favourite music. This Android smartphone supports a microSD memory card of up to 32GB. It should be noted that the memory card does not come included in the packaging and can be bought separately.', 'https://images-na.ssl-images-amazon.com/images/I/81S6qfVnW-L._SL1500_.jpg', '47.95', '', '', ''),('8', 'Jitterbug Flip Easy-to-Use Cell Phone for Seniors - Red by GreatCall', 'Thoughtfully designed for no-hassle daily use, the Jitterbug Flip takes simplicity to the next level with features like: big buttons, simple “Yes” and “No” navigation, a backlit keypad and a powerful speaker for clear conversations. A convenient built-in camera makes it easy to capture and share every special moment and holds up to 1,000+ photos. With plans as low as $14.99 per month, staying in touch with family and friends is easier than ever. From the large buttons to the easy-to-use interface, the jitterbug Flip was engineered with the unique needs of seniors and simplicity lovers in mind.', 'https://images-na.ssl-images-amazon.com/images/I/71ukSZ3p5fL._SL1500_.jpg', '60.76', '', '', ''),('9', 'HP OfficeJet 4650 Wireless All-in-One Photo Printer with Mobile Printing, Instant Ink ready (F1J03A)', '[HP_LOGO.JPG] CATEGORY: PRINTERS,INKJET,MULTI-FUNCTION-COLOR MANUFACTURER: HEWLETT PACKARD HARDWARE - HEWLETT PACKARD COMPANY PART NUMBER: F1J03A#B1H UPC: 889296269809 Accomplish next-level productivity with the easiest way to print from your smartphone or tablet. Fly through tasks with an all-in-one with fax, automatic document feeder, and wireless and save up to 50% on ink with the HP Instant Ink Program. Get high-quality printsÃ¢â'¬â€time after timeÃ¢â'¬â€with an all-in-one designed and built to be reliable. Save your space with a sleek all-in-one designed to fit where you need it. Print in any room you choose without causing disruptions using the optional quiet mode.', 'https://images-na.ssl-images-amazon.com/images/I/71sDg%2By9t4L._SL1500_.jpg', '84.98999999999999', '', '', ''),('10', 'Canon imageCLASS MF247dw Wireless, Multifunction, Duplex Laser Printer', 'The all-in-one, Canon imageCLASS MF247dw has print, scan, copy and fax capabilities so you can accomplish all necessary tasks with just one machine. Your professional quality documents are printed at speeds of up to 28 pages per minute in black and white with a quick first print time of 6 seconds or less. Eco friendly, all mode duplexing right out of the box allows you to save on paper and related costs. The tiltable, 6-line touch LCD panel allows you to navigate through the menu seamlessly. The wide screen is user friendly and easy to read, and you can also customize your home screen to access your most commonly used features quickly and easily. The imageCLASS MF247dw has wireless connectivity, increasing your productivity and allowing you to print from almost anywhere in your home or office. The device also has built in Wi-Fi Direct capability, enabling easy connection to mobile devices without a router. The imageCLASS MF247dw is equipped with a variety of easy to use mobile capabilities for printing on-the-go using your compatible mobile device, such as Apple AirPrint, Mopria Print Service and Google Cloud Print. You can also scan hardcopy originals using the Canon PRINT Business app. The imageCLASS MF247dw supports host-based UFR II LT and PCL 5e/6 languages to provide printing versatility. You can also send scanned documents and forward received faxes through email or file server. With ID Card Copy, you can easily create copies of identification cards or other small documents on a single page. With the front-loading 250-sheet paper cassette, 35-sheet automatic document feeder and 1-sheet multipurpose tray, your paper handling requirements are covered. The imageCLASS MF247dw uses less than 2 watts of energy in wireless, Energy Saver Mode, helping you save money on energy costs. The Single Cartridge System combines the toner and drum into 1 unit, making replacement of cartridges simple. This machine uses Canon GENUINE Toner, Cartridge 137.', 'https://images-na.ssl-images-amazon.com/images/I/51LsIu6zMPL._SY355_.jpg', '159.99', '', '', ''),('11', 'Samsung Electronics UN65MU6300 65-Inch 4K Ultra HD Smart LED TV (2017 Model)', 'Samsung Electronics UN65MU6300 65-Inch 4K Ultra HD Smart LED TV (2017 Model)', 'https://images-na.ssl-images-amazon.com/images/I/616%2BK6M825L._SL1000_.jpg', '879', '', '', ''),('12', 'Sceptre X415BV-FSR Slim LED 1080p HDTV, 40", True Black (2017 Model)', 'Welcome the wide-ranging color and clarity of 1080P resolution into your home with the X415BV-FSR 40" LED HDTV. With 3 HDMI ports (HDMI 1 is shared with MHL), picture quality and streaming access is available at its fullest potential. Clear QAM conveniently delivers cable channels to your HDTV without the need for an antenna. With a MEMC 120 (Motion Estimation and Motion Compensation), all action-packed sequences will flow smoothly from frame to frame for the ultimate experience. Enjoy every moment of the auto enhanced picture quality especially for all your favorite sports, video games, and movies packed with action.', 'https://images-na.ssl-images-amazon.com/images/I/71o6E6A4-1L._SL1080_.jpg', '229.95', '', '', ''),('13', 'Bose SoundLink Color Bluetooth speaker II - Soft black', 'From the pool to the park to the patio, the SoundLink Color Bluetooth speaker II provides full-range, portable sound anywhere you go. Advanced Bose technology packs big sound into a small, water-resistant speaker that’s durable enough to take with you however the day unfolds, even if it’s next to the pool. It’s durably built, with an easy-touch silicone texture that won’t slip out of your hand when you’re on the move. And it’s just as simple to use—voice prompts tell you what device you’re paired to so you don’t have to guess, and if you’re using an NFC-enabled device, just pair with a tap. Need to keep the music flowing? You’re covered with up to 8 hours of music, and it’s rechargeable via Micro-B USB. There’s even a built-in speakerphone to handle calls without holding your phone. Also download the Bose Connect app to drag and drop Bluetooth connections, unlock features and access updates down the line. This small colored wireless speaker is available in Aquatic Blue, Coral Red, Soft Black or Polar White. Included: SoundLink Color Bluetooth speaker II; USB cable.', 'https://images-na.ssl-images-amazon.com/images/I/614CIL31pML._SL1000_.jpg', '129', '', '', ''),('14', 'AmazonBasics Shockproof and Waterproof Bluetooth Wireless Mini Speaker', 'AmazonBasics brings you everyday items at a great value. An Amazon Brand.', 'https://images-na.ssl-images-amazon.com/images/I/814brDKfU9L._SL1500_.jpg', '21.59', '', '', ''),('15', 'Pioneer Andrew Jones Designed Floorstanding Loudspeaker Audio Bundle (2-Pack) - SP-FS52', 'Even when you don't have a fortune to spend on speakers, it's easy to set your sights higher starting from the ground up. Introducing the new SP-FS52 Floor Standing Speakers from Pioneer. Designed with uncompromising attention to detail, these speakers are ideal for home theater systems, offering remarkable audio quality from CDs, videos, gaming and any other audio source. Using three 5-1/4 inch woofers with oversized magnets for powerful bass, these speakers deliver the kind of high performance and exceptional quality that makes for a stunning music and home theater experience. Pioneer has been the industry leader in audio design and engineering firsts for over 70 years. Designed by Pioneer's Chief Speaker Engineer, Andrew Jones, these speakers embody all his high-end expertise and passion for pure audio reproduction. And while audio enthusiasts gladly pay as much as $80,000 for some of Andrew's designs, you'll find these new SP-FS52 speakers considerably more affordable. It's okay to stare. With true curved cabinet design, not only are the SP-FS52 Floor Standing Speakers aesthetically more pleasing, so is the entire listening experience. The high-performance and exceptional sound quality is the result of this stiffer design, which reduces standing sound waves inside the cabinet. As a literal example of the term "beautifully engineered", the elegant and appealing speaker grills on the SP-FS52s protect the speakers, but are also removable if you prefer to see the drivers exposed. Crossover: The job of the crossover in a speaker is to break the audio signal into low, high and sometimes mid-range frequencies. It's an important job, and it uses circuitry like inductors and capacitors to accomplish it. Much of the competition uses an extremely simple, low-cost crossover made up of a single capacitor and inductor. The Pioneer SP-FS52 utilizes a sophisticated 8 component high quality crossover.', 'https://images-na.ssl-images-amazon.com/images/I/61JSLgWnj1L._SL1000_.jpg', '198', '', '', ''),('16', 'KEF REF5GB REFERENCE 5 Floorstanding Loudspeaker - High Gloss Piano Black (Pair)', 'The KEF REFERENCE 5 exemplifies the passion for innovation that underpins our REFERENCE series' design philosophy. Whether you're listening to music or watching a film, the REFERENCE 5 reveals subtleties you'd never noticed before with a gripping, powerful performance. The REFERENCE 5 is perfection embodied in a tall three-way floorstanding speaker that aligns four powerful, extremely linear 6.5 inch bass drivers, two above and two below our latest 5 inch MF/HF Uni-Q array, which features a sensational 1 inch vented aluminum dome tweeter at its acoustic center. With the Uni-Q's broad inclusive dispersion, everyone in the room can enjoy the same rich, spatially-precise acoustic imagery without being restricted to a narrow sweet spot. Like the rest of the REFERENCE series, your REFERENCE 5 is handmade with great precision by our virtuoso engineers in the UK. This includes the tuning of your speakers, the incredible mathematics that dictate the speaker's pristine sound, and even the hardwood cabinet all its components are housed in. The end result is a speaker which commands a magisterial presence over its competitors, in both sound quality and style.', 'https://images-na.ssl-images-amazon.com/images/I/71LjQpIzpdL._SL1500_.jpg', '18999.99', '', '', ''),('17', 'Bose SoundLink around-ear wireless headphones II Black', 'Enjoy a better wireless experience with Bose sound link around-ear wireless headphones ii. Exclusive technology delivers deep, immersive sound at any volume, making them the best-sounding wireless headphones available. A dual microphone system rejects noise and wind so you'll be heard loud and clear. And enhanced side tone makes your voice sound more natural. Sound link wireless headphones use the latest Bluetooth technology so you can easily connect to your mobile devices with seamless audio/video sync and switch between two devices. For nfc-enabled devices, you can simply tap the right ear cup for quick pairing. A rechargeable lithium-ion battery lets you listen for up to 15 hours and gives you up to 2 hours of play time with a 15-minute charge. Effortless touch controls allow for simple command of your music and calls. And voice prompts give you information about battery life, device connection and caller id. Sound link wireless headphones are lighter and more comfortable than other comparable wireless headphones so you can enjoy them all day long. Wear them almost anywhere, and experience uncompromised wireless performance. Included: sound link around-ear headphones; detachable audio cable; carrying case.', 'https://images-na.ssl-images-amazon.com/images/I/6188bLRU64L._SL1000_.jpg', '229', '', '', ''),('18', 'Audio-Technica ATH-M30x Professional Monitor Headphones', 'The M-Series ATH-M30x professional monitor headphones combine modern engineering and high-quality materials to deliver a comfortable listening experience, with enhanced audio clarity and sound isolation. Tuned for highly detailed audio, with strong mid-range definition, these versatile monitoring headphones are ideal in a variety of situations. Designed primarily for studio tracking and mixing, they offer added features for increased portability, making them a great choice for field recording.', 'https://images-na.ssl-images-amazon.com/images/I/81APjlVpgbL._SL1500_.jpg', '68', '', '', ''),('19', 'Sony MDRXB50AP Extra Bass Earbud Headset (Black)', '12mm Drivers<BR>Extra Bass Design<BR>In-Line Mic&amp; Remote<BR>Sony Smart Key App Compatible<BR>Customized Android Control<BR>', 'https://images-na.ssl-images-amazon.com/images/I/61p1oDWAPUL._SL1200_.jpg', '25.99', '', '', ''),('20', 'Bluetooth Headphones TaoTronics Wireless Earbuds Sport Earphones 9 Hours 4.2 Magnetic Lightweight & Fast Pairing (cVc 6.0 Noise Cancelling Mic, Snug Silicon Earbuds, Magnetic Design)', 'Give yourself that extra motivation when exercising with the TaoTronics Wireless Headphones Stereo Earphones. Designed as Bluetooth headphones for running, these lightweight in-ear headphones weigh only 0.53 oz / 15 g and are incredibly comfortable thanks to ergonomically shaped in-ear earbuds. With long-term use in mind, the highly elastic silicon covering can withstand wear-and-tear for those that exercise or listen to music every day. IPX6 Splash Proof Build If you hit the track or lift weights, then you’re bound to build up a sweat. Thankfully, the headphones come with an inner nano-coating that protects them from moisture. It’s not only sweat that it protects, but also light rain - for those that exercise no matter the weather. Secure Headphones with Built-In Magnets When not in your ears, keep the Bluetooth earphones together with built-in magnets. Not only do the magnets offer a way to prevent the headphones from sliding off your shoulders when not in use, they also offer a sporty, yet secure way to hold them. Clear and Easy Communication Talking on the phone can be fraught with problems including signal drops, background noise, or voice transmission errors. To combat this, the headphones feature cVc 6.0 and a MEMS microphone. With built-in cVc 6.0 noise cancellation technology, background disturbances are reduced. The MEMS microphone is an upgraded version of the traditional microphone, which enables a higher sensitivity and a greater performance so your voice transmits with ease. 9 Hour Battery Life with iOS Indicator If you’re running a marathon or planning a hike, you’ll have more than enough music thanks to a generous 9 hour battery. When it eventually runs out, it can be fully recharged after only 2 hours. For those connected to an iOS device, a handy indicator will show on your device’s screen so you know how much headphone battery is left.', 'https://images-na.ssl-images-https://www.amazon.com/Headphones-TaoTronics-Sweatproof-Lightweight-Cancelling/dp/B074QKS8RK/ref=lp_12097478011_1_7?s=aht&ie=UTF8&qid=1519190124&sr=1-7amazon.com/images/I/51ru85hMQTL._SL1000_.jpg', '25.99', '', '', ''),('21', 'Bananas, 1 bunch', 'One bunch contains approximately 5-7 bananas. Product is shipped right before it’s ready to eat but it may take up to one day to ripen. Color may vary from slightly green to yellow.', 'https://images-na.ssl-images-amazon.com/images/I/71gI-IUNUkL._SL1500_.jpg', '1.58', '', '', ''),('22', 'Strawberries, 1 lb', 'AmazonFresh guarantees every product will be delivered to your home well within the manufacturer's recommended use by, sell by, best by or expiration date.', 'https://images-na.ssl-images-amazon.com/images/I/8143FLAy6GL._SL1500_.jpg', '2.89', '', '', ''),('23', 'Yellow Onion, One Large', 'AmazonFresh guarantees every product will be delivered to your home well within the manufacturer's recommended use by, sell by, best by or expiration date.', 'https://images-na.ssl-images-amazon.com/images/I/71785Jrt80L._SL1483_.jpg', '0.8100000000000001', '', '', ''),('24', 'Fresh Atlantic Salmon, Skin-On, Farm-Raised, 12 oz', 'Marine Harvest Atlantic Salmon is fresh and never frozen; try it baked, broiled, pan-fried, or grilled. Two servings per package; each 6 oz. portion contains 35 grams of protein and 100% of the recommended daily value of Vitamin D.', '', '7.49', '', '', ''),('25', 'Cucumber, Medium', 'AmazonFresh guarantees every product will be delivered to your home well within the manufacturer's recommended use by, sell by, best by or expiration date.', 'https://images-na.ssl-images-amazon.com/images/I/71t9Hf2OZ0L._SL1500_.jpg', '0.77', '', '', ''),('26', 'Just BARE Chicken, Hand-Trimmed Boneless, Skinless Chicken Thighs, 1.25 lb', 'No added hormones. No antibiotics - ever! Third-party animal humane certified. Born, raised, and harvested in United States.